import React, { Component } from 'react'
import {ListGroup,ListGroupItem,PageHeader} from 'react-bootstrap'
import './List.css'

export default class List extends Component {
  render() {
    return (
           <div id="container">  
           <PageHeader className="tracking-in-expand-fwd-top" style={{fontFamily: "'Alfa Slab One', cursive",color:"green",textShadow:"2px 2px lightgreen"}}>List of players</PageHeader> 
           <ListGroup style={{width:"80%"}}>
           {this.props.mainstate.players.map((player,index)=><ListGroupItem><span>{index+1}.&nbsp;Name:{player.value}&nbsp;Rating:{player.rating} </span></ListGroupItem> )}
           </ListGroup>;
           </div>
    )
  }
}
